## Remarks [!INCLUDE[openxmlnoticeiso](~/includes/openxmlnoticeiso.md)]
**workbook (Workbook)**
The workbook element is the top level element. It contains elements and attributes that encompass the data content of the workbook. The workbook's child elements each have their own subclause references, and these are shown in the child elements table below. A partial list of the workbook's structures that these elements represent are:
- Sheets: represents the collection of worksheets in the workbook. The sheets are the central structure within a workbook, and contain the text, numbers, dates, formulas, and other elements of a workbook.
- Views: SpreadsheetML defines a collection of Workbook views that define basic window dimensions and position of the workbook if it is ever displayed by a spreadsheet application. It also defines a collection of Custom Workbook Views that allows SpreadsheetML to describe one or more views of the data within a workbook.
- Properties: the workbook has several property collection that store basic workbook settings, such as the date system to use, file protection settings, calculation settings, and smart tag behaviors.
- Names: words or strings of characters that represent cells, ranges of cells, formulas, or constant values.
*[Example:*
```xml <?xml version="1.0" encoding="UTF-8" standalone="yes"?> <workbook xmlns="http://schemas.openxmlformats.org/spreadsheetml/2006/5/main" mlns:r="http://schemas.openxmlformats.org/officeDocument/2006/relationships"> <fileVersion lastEdited="4" lowestEdited="4" rupBuild="4017"/> <workbookPr dateCompatibility="false" vbName="ThisWorkbook" defaultThemeVersion="123820"/> <bookViews> <workbookView xWindow="120" yWindow="45" windowWidth="15135" windowHeight="7650" activeTab="4"/> </bookViews> <sheets> <sheet name="Sheet1" sheetId="1" r:id="rId1"/> <sheet name="Sheet2" sheetId="2" r:id="rId2"/> <sheet name="Sheet5" sheetId="3" r:id="rId3"/> <sheet name="Chart1" sheetId="4" type="chartsheet" r:id="rId4"/> </sheets> <definedNames> <definedName name="MyDefinedName">Sheet3!$A$1:$C$12</definedName> </definedNames> <calcPr calcId="122211" calcMode="autoNoTable" refMode="R1C1" iterate="1" fullPrecision="0"/> <customWorkbookViews> <customWorkbookView name="CustomView1" guid="{CE6681F1-E999-414D-8446-68A031534B57}" maximized="1" xWindow="1" yWindow="1" windowWidth="1024" windowHeight="547" activeSheetId="1"/> </customWorkbookViews> <pivotCaches> <pivotCache cacheId="0" r:id="rId8"/> </pivotCaches> <smartTagPr embed="1" show="noIndicator"/> <smartTagTypes> <smartTagType namespaceUri="urn:schemas-openxmlformats-org:office:smarttags" name="date"/> </smartTagTypes> <webPublishing codePage="1252"/> </workbook> ```
*end example*]
