## Examples The following code example opens an existing spreadsheet document and adds a new worksheet, named "mySheet," and associates it with the workbook.
```csharp using System; using System.Linq; using DocumentFormat.OpenXml.Packaging; using DocumentFormat.OpenXml.Spreadsheet;
namespace WorkbookEx { class Program { static void Main(string[] args) { string fileName = @"C:\Users\Public\Documents\WorkbookEx.xlsx"; // Open an existing spreadsheet document for editing. using (SpreadsheetDocument spreadSheet = SpreadsheetDocument.Open(fileName, true)) { // Add a blank WorksheetPart. WorksheetPart newWorksheetPart = spreadSheet.WorkbookPart.AddNewPart<WorksheetPart>(); newWorksheetPart.Worksheet = new Worksheet(new SheetData());
// Create a Sheets object in the Workbook. Sheets sheets = spreadSheet.WorkbookPart.Workbook.GetFirstChild<Sheets>(); string relationshipId = spreadSheet.WorkbookPart.GetIdOfPart(newWorksheetPart);
// Create a unique ID for the new worksheet. uint sheetId = 1; if (sheets.Elements<Sheet>().Count() > 0) { sheetId = sheets.Elements<Sheet>().Select(s => s.SheetId.Value).Max() + 1; }
// Give the new worksheet a name. string sheetName = "mySheet" + sheetId;
// Append the new worksheet and associate it with the workbook. Sheet sheet = new Sheet() { Id = relationshipId, SheetId = sheetId, Name = sheetName }; sheets.Append(sheet); } Console.WriteLine("All done. Press a key."); Console.ReadKey(); } } }
```
``` Imports System.Linq Imports DocumentFormat.OpenXml.Packaging Imports DocumentFormat.OpenXml.Spreadsheet Module Module1 Sub Main() Dim fileName As String = "C:\Users\Public\Documents\WorkbookEx.xlsx" ' Open an existing spreadsheet document for editing. Dim spreadSheet As SpreadsheetDocument = SpreadsheetDocument.Open(fileName, True) Using (spreadSheet) ' Add a blank WorksheetPart. Dim newWorksheetPart As WorksheetPart = spreadSheet.WorkbookPart.AddNewPart(Of WorksheetPart)() newWorksheetPart.Worksheet = New Worksheet(New SheetData())
' Create a Sheets object. Dim sheets As Sheets = spreadSheet.WorkbookPart.Workbook.GetFirstChild(Of Sheets)() Dim relationshipId As String = spreadSheet.WorkbookPart.GetIdOfPart(newWorksheetPart)
' Get a unique ID for the new worksheet. Dim sheetId As UInteger = 1 If (sheets.Elements(Of Sheet).Count > 0) Then sheetId = sheets.Elements(Of Sheet).Select(Function(s) s.SheetId.Value).Max + 1 End If
' Give the new worksheet a name. Dim sheetName As String = ("mySheet" + sheetId.ToString())
' Append the new worksheet and associate it with the workbook. Dim sheet As Sheet = New Sheet sheet.Id = relationshipId sheet.SheetId = sheetId sheet.Name = sheetName sheets.Append(sheet) End Using Console.WriteLine("All done. Press a key.") Console.ReadKey() End Sub End Module
```
